def p_n (n : ℕ) : ℝ :=
  let uniform_space := Fin n
  let square_set := {k | ∃ c d : uniform_space, c + d = k ∧ (∃ t : ℕ, t ^ 2 = k)}
  (square_set.card : ℝ) / (n * n)

def p_n (n : ℕ) : ℝ :=
  let s := {cd | ∃ c d, c + d ∈ (Finset.range (2 * n + 1)).filter (λ x, ∃ m, m^2 = x)} in
  (s.card : ℝ) / (n * n)

def p_n (n : ℕ) : ℝ :=
  let S := Finset.filter (fun x => ∃ c d, c + d = x ∧ c ∈ Finset.range n ∧ d ∈ Finset.range n) (Finset.Icc 2 (2 * n))
  in S.card.toReal / (n * n)

def p_n (n : ℕ) : ℝ :=
  let uniform_dist := PMF.uniform (Finset.range n) in
  ∑ k in Finset.range (2 * n), uniform_dist (λ c, k - c) * uniform_dist (λ d, c) * (k.is_square ?_ = 1)

def p_n (n : ℕ) : ℝ :=
  let S := {c d | c + d ∈ {k ^ 2 | k : ℕ} ∧ 1 ≤ c ∧ c ≤ n ∧ 1 ≤ d ∧ d ≤ n} in
  S.card.toReal / (n * n).toReal

def p_n (n : ℕ) : ℝ :=
  let perfect_squares := {m : ℕ | ∃ k, k ^ 2 = m}
  (Finset.card (Finset.filter perfect_squares (Finset.range (2 * n + 1)))) / (n * n)

def p_n (n : ℕ) : ℝ :=
  let S := {c | c ∈ Finset.range (n + 1)}.product {d | d ∈ Finset.range (n + 1)} in
  (S.filter (λ p, ∃ k : ℕ, k * k = p.1 + p.2)).card / S.card

def p_n (n : ℕ) : ℝ :=
  let Ω := Finset.product (Finset.range 1 n.succ) (Finset.range 1 n.succ)
  let countPerfectSquares := Finset.card (Finset.filter (λ (cd : ℕ × ℕ), ∃ k, cd.1 + cd.2 = k ^ 2) Ω)
  countPerfectSquares / Ω.card
